import React from 'react'
import Grid from '@material-ui/core/Grid'
import Paper from '@material-ui/core/Paper';
import Avatar from '@material-ui/core/Avatar';
import { makeStyles } from '@material-ui/core/styles';

const useStyles = makeStyles((theme) => ({
    root: {
      flexGrow: 1,
    },
    Paper: {
      height: 540,
      width: 100,
    },
    control: {
      padding: theme.spacing(2),
    },
  }));

export default function Notes() {
    
  return (
    <Grid container spacing={1} xs={5}>
        <Grid item xs={7}>
          <Avatar classname="avatar" src="https://upload.wikimedia.org/wikipedia/fr/4/4f/RSC_Anderlecht_logo.png"/>
        </Grid>
        <Grid item xs={6}>
          <Paper>xs=6</Paper>
        </Grid>
        <Grid item xs={1}>
          <Paper>xs=6</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper>xs=3</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper>xs=3</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper>xs=3</Paper>
        </Grid>
        <Grid item xs={3}>
          <Paper>xs=3</Paper>
        </Grid>
      </Grid>
    

  )
}
